import React from 'react';
import './App.css';
import { Box } from '@mui/material';

function App() {
  return (
    <Box className='App'>
      <Box sx={{background: '#332F2F', width: '300px', height:'500px'}}>
        <Box sx={{background: '#ffffff', width: '300px', height:'350px'}}></Box>
      </Box>
    </Box>
  );
}

export default App;
